import React, { useState } from "react";
// import Mainimage from "../public/image/main.jpg";
const FFheader = () => {

  const [shpwMediaIcons, setshpwMediaIcons] = useState

  return (
    <>
    <header>
      <div className="navbar">

          {/* ================ LOGO SECTION ================== */}

          <div className="left1"><span id="blue">FITN</span>NESS</div>
          <div className="logo1"><span id="red">FR</span>EAK</div>
          <div className="logo"><img src="../image/gorilla.png" alt=""/></div>
          
          {/* ================ SIDEBAR SECTION ============= */}
        <ul className="list-parent" id="sidebar" style={{ listStyleType: "none" }}>
            <li className="closebar">
            <i class="fa-solid fa-xmark fa-xl"></i></li>
            <li><a href="/">Home</a></li>
            <li><a href="/">Contact</a></li>
            <li><a href="/">About</a></li>
            <li><a href="/">Services</a></li>
            <li><button className="login">Login</button></li>
        </ul>  

          {/* ================ NAVBAR SECTION =============== */}

        <ul className="list-parent" style={{ listStyleType: "none" }}>
            <li className="item"><a href="/">Home</a></li>
            <li className="item"><a href="/">Contact</a></li>
            <li className="item"><a href="/">About</a></li>
            <li className="item"><a href="/">Services</a></li>
            <li className="item"><button className="login">Login</button></li>
            <li onclick="showSidebar()"className="menubar"><i class="fa-solid fa-bars fa-xl"></i></li>
        </ul>
      </div>
    </header>

          {/* ================= MAIN SECTION ================ */}

    <section className="main">
        <img src="../image/main.jpg" alt="" />
        <div className="main-headlines">
          <span className="main-words">WORK HARDER, GET STRONGER </span>
          <h2 className="main-headline">EASY WITH OUR <span className="">GYM</span></h2>
          <button className="main-headline-login">BECOME A MEMBER</button>
        </div>
    </section>
    </>
  );
};

export default FFheader;
